CREATE TABLE IF NOT EXISTS `assets` (`at_uid` int(11) NOT NULL AUTO_INCREMENT,`at_id` varchar(32) NOT NULL,`at_collection` varchar(64) NOT NULL,`at_order` int(11) NOT NULL DEFAULT 0,`at_name` varchar(256) NOT NULL,`at_type` varchar(16) NOT NULL,`at_time` decimal(8,4) NOT NULL DEFAULT 5.0000,`at_action` text NOT NULL,`at_frames` int(11) NOT NULL DEFAULT 1,`at_frtime` int(11) NOT NULL DEFAULT 100,`at_file1` varchar(1024) NOT NULL,`at_file2` varchar(1024) NOT NULL,`at_file3` varchar(1024) NOT NULL,`at_file4` varchar(1024) NOT NULL,`at_file5` varchar(1024) NOT NULL,PRIMARY KEY (`at_uid`),KEY `at_id` (`at_id`),KEY `at_collection` (`at_collection`)) ENGINE=InnoDB;
